import Info from "./compenents/Info";
import Opening from "./compenents/Opening";
import classes from "./HomeLayout.module.css";
function Home(){
    return<section id="Home" className={classes.Infos}>
        <Opening Name="Esau Lopez" p1="Welcome to my site!" />
        <div ><Info id="1" text="First" /> </div>
        <div ><Info id="4" text="Fourth" /> </div>

    </section>

}
export default Home;
